      SELECT DISTINCT + - 53, - 80 AS col1 FROM tab1 (FORMAT parquet) cor0 WHERE ( NOT ( ( NOT - + col1 * + - 38 NOT BETWEEN NULL AND + col0 + col2 + col2 * + col2 ) ) );
  - name: tab1

outputs:
  - name: q5313.out
    data: |
